  \"2016-07-27T22:20:57.820839\",\n\t\"name\": \"management-plan-part-3-chapter-1-marsh-and-water-management-st-vincent-national-wildlife-r\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The proposed water and marsh management
  at St. Vincent National Wildlife Refuge is limited to freshwater.  Management strategies
  include cyclic water level manipulations and cattail control.  Existing and additional
  vegetation transects will be surveyed on an annual basis to determine the impacts
  of marsh management on vegetation composition.  The wildlife goals to be accomplished
  are to: enhance and maintain endangered and threatened species habitat, enhance
  habitats for migratory birds (including waterfowl), increase/enhance wood duck production,
  maintain as much naturalness as possible while meeting wildlife objectives, and
  maintain a natural diversity of healthy resident wildlife populations.\",\n\t\"license_title\":
